INSERT INTO jd_shop_config VALUES('121','1','shop_notice','textarea','','','<marquee onMouseOver=this.stop() onMouseOut=this.start() scrollamount=1 scrolldelay=7 direction=up width=950 height=150><p style=\"font-size:18px;color:blue\">感谢光临77商城 您的每一次光临让我们在激烈的市场竞争中 赢得了那份荣耀 让我们内心的热血\r\n\r\n\r\n\r\n在次沸腾 我们将付出12分的努力给您以最优质的服务 最低廉的价格 最快速的售后 让每一单产品\r\n\r\n\r\n\r\n都带去最真挚的祝福  本公司经过近10年的努力与发展  已经与各大厂商及省市级代理商建立了长期\r\n稳定的兄弟级合作关系  质量与售后 价格与服务有明显的优势与保障  本公司设有专业的物流部门\r\n\r\n\r\n\r\n与优秀的售后团队 可以满足客户的质量  价格 售后 服务的全方位要求  主要经营DIY 笔记本 手机\r\n\r\n\r\n\r\n 数码 投影 办公用品 网络安防 商用耗材等   \r\n\r\n用价格战胜友军  用质量征服客户 用售后保证信誉 \r\n（产品陆续完善中 敬请期待）</p></marquee>','1');
