pan style=\"background: white; color: #666666; font-size: 9pt\">，点击</span><span style=\"background: white; color: #666666; font-size: 9pt\">&ldquo;</span><span style=\"background: white; color: #666666; font-size: 9pt\">立即注册</span><span style=\"background: white; color: #666666; font-size: 9pt\">&rdquo;</span><span style=\"background: white; color: #666666; font-size: 9pt\">，完成注册。请在注册时务必详细填写个人信息；</span></div>\r\n<p><img alt=\"\" width=\"1058\" height=\"615\" src=\"/images/upload/Image/2(1).jpg\" /></p>\r\n<p><img alt=\"\" width=\"1009\" height=\"124\" src=\"/images/upload/Image/3(2).jpg\" /></p>\r\n<p><span style=\"background: white; color: #666666; font-size: 9pt\">3</span><span style=\"background: white; color: #666666; font-size: 9pt\">、对于忘记密码，我们提供了找回密码的功能，但是目前只能与我们的客服人员联系，我们来帮您找回密码。</span></p>\r\n<p><span style=\"background: white; color: #666666; font-size: 9pt\"><img alt=\"\" width=\"816\" height=\"37\" src=\"/images/upload/Image/4(4).jpg\" /></span></p>\r\n<p><span style=\"background: white; color: #666666; font-size: 9pt\"><span style=\"color: #666666; font-size: 9pt\">1、<span style=\"font: 7pt \'Times New Roman\'\">&nbsp;&nbsp; </span></span><span style=\"background: white; color: #666666; font-size: 9pt\">浏览要购买的商品，点击</span><span style=\"background: white; color: #666666; font-size: 9pt\">&ldquo;</span><span style=\"background: white; color: #666666; font-size: 9pt\">加入购物车</span><span style=\"background: white; color: #666666; font-size: 9pt\">&rdquo;</span><span style=\"background: white; color: #666666; font-size: 9pt\">商品会自动添加到购物车里；</span></span></p>\r\n<div style=\"text-indent: -18pt; margin: 0cm 0cm 0pt 18pt\"><span style=\"color: #666666; font-size: 9pt\">2、<span style=\"font: 7pt \'Times New Roman\'\">&nbsp;&nbsp; </span></span><span style=\"background: white; color: #666666; font-size: 9pt\">如果需要更改商品数量，需在商品所在栏目后的商品数量框中输入购买数量；</span></div>\r\n<div style=\"text-indent: -18pt; margin: 0cm 0cm 0pt 18pt\"><span style=\"background: white; color: #666666; 